    let response = await fetch(url);
    let activityData = await response.json();
    return activityData
  }

const App = () => {

    const [start, setStart] = useState(false);

    return (
          <div className="main bg-gradient">
            <nav className="navbar navbar-light bg-light">
                <div className="container-fluid">

                <a class="navbar-brand mx-auto" href="#">
                    <img src='/trivia.jpg' alt="" width="200" height="50"/>
                </a>
                </div>
            </nav>
            <div className="container">
            <div className="row row-cols-5 row-cols-sm-5 row-cols-md-5">
                    <h1>
                        LEt's begin!
                    </h1>
                </div>
                <div className="row row-cols-5 row-cols-sm-5 row-cols-md-5">
                    <Setup isStart={start}/>
                </div>

            </div>
        </div>
      )

}



export default App;
